function Tarjeta(props) {
  let randomName = () => {
    let names = ["Axel", "Rica", "Azule"];
    let randomIndex = Math.floor(Math.random() * 3);
    return names[randomIndex];
  };
  return (
    <div>
      <h2>{props.titulo}</h2>
      <h3>{randomName()}</h3>
      <button onClick={randomName}>Click</button>
      <p>{props.descripcion}</p>
    </div>
  );
}

export default Tarjeta;
